def downsample2d(inputs, numFilters):

  pool = MaxPooling2D((2,2), strides = 2)(inputs)
  #pool = Conv2D(numFilters, (1,1), padding = 'same', kernel_initializer = 'he_normal')(pool)

  conv1 = Conv2D(numFilters, (1,1), padding = 'same', kernel_initializer = 'he_normal')(inputs)
  conv1 = Conv2D(numFilters, (3,3), strides = (2,2), padding = 'same', kernel_initializer = 'he_normal')(conv1)
  #conv1 = Conv2D(numFilters, (1,1), padding = 'same', kernel_initializer = 'he_normal')(conv1)

  conv2 = Conv2D(numFilters, (1,1), padding = 'same', kernel_initializer = 'he_normal')(inputs)
  conv2 = Conv2D(numFilters, (3,3), padding = 'same', kernel_initializer = 'he_normal')(conv2)
  conv2 = Conv2D(numFilters, (3,3), strides = (2,2), padding = 'same', kernel_initializer = 'he_normal')(conv2)
  #conv2 = Conv2D(numFilters, (1,1), padding = 'same', kernel_initializer = 'he_normal')(conv2)

  concat = concatenate([pool, conv1, conv2], axis=3)

  out = Conv2D(numFilters, (1,1), padding = 'same', kernel_initializer = 'he_normal')(concat)

  return out


def upsample2d(inputs, numFilters):

  up = UpSampling2D((2,2))(inputs)

  convT1 = Conv2DTranspose(numFilters, (1,1), padding='same')(inputs)
  convT1 = Conv2DTranspose(numFilters, (3,3), strides=2, padding='same')(convT1)

  convT2 = Conv2DTranspose(numFilters, (1,1), padding='same')(inputs)
  convT2 = Conv2DTranspose(numFilters, (3,3), padding='same')(convT2)
  convT2 = Conv2DTranspose(numFilters, (3,3), strides= 2, padding='same')(convT2)

  concat = concatenate([up, convT1, convT2], axis = 3)

  out = Conv2D(numFilters, (1,1), padding = 'same', kernel_initializer = 'he_normal')(concat)

  return out

def DIUnet():

  inputs = Input((48, 48, 1))
  numFilters = 32
  

  conv1 = Conv2D(numFilters, (1, 1), activation=None, padding="same")(inputs)
  conv1 = Dropout(0.18)(conv1)
  conv1 = inception_res_block_down(conv1, numFilters)
  conv1= BatchNormalization()(conv1)
  conv1 = Activation('relu')(conv1)

  dw1 = downsample2d(conv1, numFilters)

  #conv2 = Conv2D(numFilters * 2, (1, 1), activation=None, padding="same")(dw1)
  conv2 = inception_res_block_down(dw1, numFilters*2)
  conv2 = Dropout(0.7)(conv2)
  conv2 = BatchNormalization()(conv2)
  conv2 = Activation('relu')(conv2)

  dw2 = downsample2d(conv2, numFilters*2)

  conv3 = inception_res_block_down(dw2, numFilters*4)
  conv3 = Dropout(0.7)(conv3)
  conv3 = BatchNormalization()(conv3)
  conv3 = Activation('relu')(conv3)

  dw3 = downsample2d(conv3, numFilters*4)

  conv4 = dense_inception_block_down(dw3, numFilters*8)
  conv4 = Dropout(0.7)(conv4)
  conv4 = BatchNormalization()(conv4)
  conv4 = Activation('relu')(conv4)

  dw4 = downsample2d(conv4, numFilters*8)

  conv5 = dense_inception_block_down(dw4, numFilters*16)
  conv5 = Dropout(0.7)(conv5)
  conv5 = BatchNormalization()(conv5)
  conv5 = Activation('relu')(conv5)
  

  up4 = upsample2d(conv5, numFilters*16)
  concat4 = concatenate([up4, conv4])

  conv6 = dense_inception_block_up(concat4, numFilters*8)
  conv6 = Dropout(0.7)(conv6)
  conv6 = BatchNormalization()(conv6)
  conv6 = Activation('relu')(conv6)

  up3 = upsample2d(conv6, numFilters*8)
  concat3 = concatenate([conv3, up3])

  conv7 = inception_res_block_up(concat3, numFilters*4)
  conv7 = Dropout(0.7)(conv7)
  conv7 = BatchNormalization()(conv7)
  conv7 = Activation('relu')(conv7)

  up2 = upsample2d(conv7, numFilters*4)
  concat2 = concatenate([up2, conv2])

  conv8 = inception_res_block_up(concat2, numFilters*2)
  conv8 = Dropout(0.7)(conv8)
  conv8 = BatchNormalization()(conv8)
  conv8 = Activation('relu')(conv8)

  up1 = upsample2d(conv8, numFilters*2)
  concat1 = concatenate([conv1, up1])

  conv9 = inception_res_block_up(concat1, numFilters)
  conv9 = Dropout(0.7)(conv9)
  conv9 = BatchNormalization()(conv9)
  conv9 = Activation('relu')(conv9)

  conv10 = inception_res_block_up(conv9, 16)
  conv10 = Dropout(0.7)(conv10)
  conv10 = BatchNormalization()(conv10)
  conv10 = Activation('relu')(conv10)

  output_layer_noActi = Conv2D(1, (1, 1), padding="same", activation=None)(conv10)
  output_layer = Activation('sigmoid')(output_layer_noActi)

  model = Model(inputs=inputs, outputs=output_layer)

  model.compile(optimizer=Adam(lr=0.001), loss='binary_crossentropy', metrics=['accuracy'])

  return model

